@finance_hipster Oh, I would never take my own in to a coffee shop.

The money they charge isn’t for the coffee. It’s for the chair. The staff. The lights. The rent. 

But also because my coffee is better - other customers may get jealous!🤣🤣🤣

@finance_hipster I have a travel mug that has a French press mesh inside. I grind fresh beans in the morning, take them to the office.

Now my afternoon coffee just needs a kettle to taste better than any coffee shop. 

It’s not just the money. If you think, you can do better for cheaper. 🧐

@paulhbast FI &gt; RE

But the path to RE is so similar as the one to FI that you learn all the same lessons.

Let’s face it. The kind of people who actually achieve FI “early” aren’t likely to “retire”.

Gonna watch this later. 📺 

